class Solution {
public:
    /**
     * @param arrays: a list of array
     * @param k: An integer
     * @return: an integer, K-th largest element in N arrays
     */
    int KthInArrays(vector> &arrays, int k) {
        // write your code here

        std::priority_queue, std::greater> queue;
        for (const auto& array : arrays) {
            for (int num : array) {
                queue.push(num);

                if (queue.size() > k) {
                    queue.pop();
                }
            }
        }

        return queue.top();
    }
};

