class DisjointSet {
public:
    DisjointSet()
      : count(0)
    { }

    void add(int x) {
        parent[x] = x;
        ++count;
    }

    int find(int x) {

        if (parent[x] == x) {
            return x;
        }

        parent[x] = find(parent[x]);
        return parent[x];
    }

    void unite(int x, int y) {

        int px = find(x);
        int py = find(y);

        if (px != py) {
            parent[px] = py;
            --count;
        }
    }

    int getNumberOfSets() {
        return count;
    }

private:
    int count;
    std::unordered_map parent;
};


