struct Record {

    int depth;
    std::vector::iterator bgn, end;

    Record(int depth,
            std::vector::iterator&& bgn,
            std::vector::iterator&& end)
      : depth(depth), bgn(bgn), end(end)
    { }
};


class Solution {
public:
    int depthSum(const vector& nestedList) {
        // Write your code here

        int sum = 0;

        std::stack stk;
        auto& input = const_cast&>(nestedList);
        stk.push(Record(1, input.begin(), input.end()));

        while (!stk.empty()) {

            auto top = stk.top();
            stk.pop();

            auto& bgn = top.bgn;
            auto& end = top.end;
            int depth = top.depth;

            while (bgn != end) {
                if (bgn->isInteger()) {
                    sum += bgn->getInteger() * depth;
                    ++bgn;
                } else {
                    auto& list =
                        const_cast&>(bgn->getList());

                    ++bgn;
                    if (bgn != end) {
                        stk.push(Record(depth, std::move(bgn), std::move(end)));
                    }

                    if (!list.empty()) {
                        stk.push(Record(depth + 1, list.begin(), list.end()));
                    }

                    break;
                }
            }
        }

        return sum;
    }
};

