private:
    void runPreOrder(TreeNode* root, int sum, int& ans) {

        sum += root->val;

        if (!root->left && !root->right) {
            ans += sum;
        }

        if (root->left) {
            runPreOrder(root->left, sum, ans);
        }
        if (root->right) {
            runPreOrder(root->right, sum, ans);
        }

