        for (int i = n - 2 ; i >= 0 ; --i) {
            if (map[s[i]] >= map[s[i + 1]]) {
                sum += map[s[i]];
            } else {
                sum -= map[s[i]];
            }
        }

        return sum;
    }

private:
    std::unordered_map map;
};

